import React from 'react'
import './Chat.css'
import {Avatar} from "@mui/material";
function Chat(){
    return(
    <div className="chat">
        <div className="Header">
            <Avatar/>
            <div className="Headerinfo">
                <h2> Room Name</h2>
            </div>
        </div>
    </div>
    );
}

export default Chat
